import axios from 'axios';

const API_URL = 'http://localhost:8080/api/attendees'; //backend URL

export const attendeeAPIService = {
  getAllAttendees: () => axios.get(API_URL),
  createAttendee: (attendee) => axios.post(`${API_URL}/add`, attendee),
  deleteAttendee: (id) => axios.delete(`${API_URL}/delete/${id}`),
};
